the year is 2308, the planet is no longer as we know it.
future bastards are the remnants of humanity.

//over 100 different traits divided into 12 categories

A generative token of gratitude.

Controls:
1) The keys from '1' to '9' can be used to re-render the artwork, where the number corresponds to the resolution multiplier (e.g., press '4' to render at 4x the initial resolution);
2) 'S' to save;
3) 'B' to toggle the blur effect on/off (this will re-render your artwork).

Features:
1) Hue: 12 Variations;
2) Number of Flowers: 5 | 15 | 25;
3) Colour of the Flower: White & Yellow | Monochromatic | Random;
4) Size of the Flower: Big | Medium | Small;
5) Distance from the Center: Big | Medium | Small;

Made with Vanilla JS
Twitter: @superbialux

Artifact III – An abstract Bouquet – is a study about geometry, light, transparency and colors, an experiment about energy and beauty emerging from simple shapes, compositions and randomness. 

WARNING – GPU Intensive! – This piece is using a special renderer, making intensive use of the GPU. Because of that, the rendering process can be really slow on low-end machines. Note that it might not work on some older computers or mobiles because of that. Note also that the previews generated are using low quality settings to help fxhash servers generating them.

THE OUTPUT CAN TAKE SEVERAL MINUTES TO BE FULLY RENDERED - So take a seat, have a break, relax and enjoy a nice cup of coffee…

Controls
// D - Display the info (samples, quality settings…)
// S - Save as png
// Q - Toggle between high/low quality
// C - Unlock camera (use your mouse, rotate/zoom to find new views!)

External settings - useful for high-res renders
// You can tweak the render settings by adding some parameters to the url (click on “open” and add the parameters at the end of the url.
// exemple: /?samples=3000&width=1920&height=1080
// recommended ratio between 1:1 and 16:9
// samples: between 10 and 5000
// width: between 100 and 4000
// height: between 100 and 4000

Made with : ThreeJS + Three-gpu-pathtracer
